  KEY `addr_uid` (`addr`(32),`uid`),
  KEY `nurl_uid` (`nurl`(32),`uid`),
  KEY `nick_uid` (`nick`(32),`uid`),
  KEY `dfrn-id` (`dfrn-id`(191)),
  KEY `issued-id` (`issued-id`(191))
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb4;
